import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import { Switch} from 'react-router-dom';
import CreateEventPage from './pages/CreateEventPage'; // Importa la página correspondiente
import ViewEventPage from './pages/ViewEventPage';
import UpdateEventPage from './pages/UpdateEventPage';
import DeleteEventPage from './pages/DeleteEventPage';

const AppRouter = () => {
  return (
    <Router>
      <Switch>
        <Route path="/create" component={CreateEventPage} />
        <Route path="/view/:id" component={ViewEventPage} />
        <Route path="/update/:id" component={UpdateEventPage} />
        <Route path="/delete/:id" component={DeleteEventPage} />
      </Switch>
    </Router>
  );
};

export default AppRouter;
